import React from 'react';
import { Text, StyleSheet, View, ScrollView, TouchableOpacity } from 'react-native';
import Searchbox from '../components/Searchbox';
import MenuDetail from '../components/CanteenDetail';

const CanteenScreen = ({ navigation }) => {

  
  return (
<ScrollView>
        <Searchbox/>

        <TouchableOpacity onPress={() => navigation.navigate('Menu')}>
        <MenuDetail 
        title='Canteen A' 
        imageSource = {require('../../assets/menu/FriedRice.jpg')}
        location='Near by HM building'/>
        </TouchableOpacity>

        <TouchableOpacity onPress={() => navigation.navigate('Menu')}>
        <MenuDetail 
        title='Canteen L' 
        imageSource = {require('../../assets/menu/FriedRice.jpg')}
        location='Near by ECC building'/>
        </TouchableOpacity>

        <TouchableOpacity onPress={() => navigation.navigate('Menu')}>
        <MenuDetail 
        title='Phrathep Canteen' 
        imageSource = {require('../../assets/menu/FriedRice.jpg')}
        location='Phrathep building'/>
        </TouchableOpacity>

        </ScrollView>  
  );
};

const styles = StyleSheet.create({});

export default CanteenScreen;
